export class Equipment {
  airConditioning: boolean = false;
  multimediaSystem: boolean = false;
  bluetoothUsb: boolean = false;
  abs: boolean = false;
  esp: boolean = false;
  reverseSensors: boolean = false;
  heatedSeats: boolean = false;
  cruiseControl: boolean = false;
  reverseCamera: boolean = false;
}
